import {AppBar,Toolbar} from '@mui/material';



const NavBar=()=>{
    return(
       <AppBar>
        <Toolbar>
           <p>Code for Interview</p>
           <p>AllUser</p>
           <p>Adduser</p>
        </Toolbar>
       </AppBar>
    )
}

export default NavBar;
